-- ----------------------------
-- Table structure for `rt_employeeinfo`
-- ----------------------------
DROP TABLE IF EXISTS `rt_employeeinfo`;
CREATE TABLE `rt_employeeinfo` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` varchar(6) NOT NULL DEFAULT '',
  `uname` varchar(10) DEFAULT NULL,
  `sex` varchar(10) DEFAULT NULL,
  `dept` varchar(20) DEFAULT NULL COMMENT '工作单位',
  `tech_pos` varchar(20) DEFAULT NULL COMMENT '人力职称',
  `admin_pos` varchar(20) DEFAULT NULL COMMENT '行政职称',
  `em_state` varchar(20) DEFAULT NULL,
  `start_work_time` varchar(20) DEFAULT NULL,
  `work_year` varchar(11) DEFAULT NULL COMMENT '工龄',
  `tech_pos_time` varchar(20) DEFAULT NULL,
  `tech_pos_year` varchar(10) DEFAULT NULL,
  `service_year` varchar(11) DEFAULT NULL COMMENT '任职年限',
  `score` varchar(11) DEFAULT NULL COMMENT '积分',
  `entrance_time` varchar(20) DEFAULT NULL,
  `graduate_time` varchar(20) DEFAULT NULL,
  `edu_system` varchar(10) DEFAULT NULL COMMENT '学制',
  `spouse_name` varchar(10) DEFAULT NULL COMMENT '配偶姓名',
  `spouse_dept` varchar(50) DEFAULT NULL COMMENT '配偶工作单位',
  `building_addr` varchar(50) DEFAULT NULL COMMENT '房屋坐落',
  `constructionArea` varchar(20) DEFAULT NULL COMMENT '建筑面积',
  `property_right` varchar(20) DEFAULT NULL COMMENT '产权或原产权',
  `tenant` varchar(10) DEFAULT NULL COMMENT '所有人或承租人',
  `category` tinyint(4) DEFAULT NULL COMMENT '类别（1研究员，2高工、高级会计师、高级经济师、高级政工师，3高级技师，4正副处，5工程师、政工师、会计师、经济师、副处调，6技师，7主任科员，8高级工）',
  `last_modify_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`,`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=2366 DEFAULT CHARSET=utf8;

